export const LawIcon = () => {
  return <img src="/law-icon.png" alt="law image" />;
};
export const MenuIcon = () => {
  return <img src="/menu-icon.svg" alt="law image" />;
};
export const Minerva = () => {
  return <img src="/minerva-header.svg" alt="law image" />;
};
export const CloseIcon = () => {
  return <img src="/close-icon.png" alt="law image" className="closeIcon" />;
};
export const Shape1 = () => {
  return <img src="/shape1.svg" alt="law image" className="shape1" />;
};
export const Shape2 = () => {
  return <img src="/shape2.svg" alt="law image" className="shape2" />;
};
export const Shape3 = () => {
  return <img src="/shape3.svg" alt="law image" className="shape3" />;
};
